import React from 'react'
import Card from './Card'
import {useSelector} from 'react-redux'

function Cards() {
    const recipe = useSelector(state => state.recipe)//TRAETE DEL ESTADO EL RECIPE
    return (
        <div>
           {
                recipe.length>0 ? 
                <div>
                    {recipe.map((e) => 
                        <Card 
                        key={e.id}
                        img={e.image}
                        title={e.title}
                        />
                    )}
                </div>
                :
                <h1>Cargando...</h1>
           }
        </div>
    )
}

export default Cards
